import React, {Component} from 'react';
/* import ComponentBreakfast from './menu/breakfast.js'*/
import ComponentButtons from './menu/buttons.js'
import ComponentHome from './home/logo.js'
import ComponentParticles from './home/particles.js'
import './App.css';
import logo from '/home/laboratoriad043/Desktop/Laboratoria/Burger-Queen/burger-queen/src/logo.svg'

class App extends Component {
  render(){
      return (  
        <React.Fragment>

          {logo}
              <ComponentHome/> 
              <ComponentParticles/> 
              <ComponentButtons/>       
         </React.Fragment> 
      );
  }
}

export default App;
